  false,\n\t\"url\": null,\n\t\"notes\": \"The 2015 cartographic boundary KMLs are
  simplified representations of selected geographic areas from the U.S. Census Bureau's
  Mastern                                 Address File / Topologically Integrated
  Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB). These boundary
  files aren                                 specifically designed for small-scale
  thematic mapping. When possible, generalization is performed with the intent to
  maintain then                                 hierarchical relationships among geographies
  and to maintain the alignment of geographies within a file set for a given year.n
  \                                Geographic areas may not align with the same areas
  from another year. Some geographies are available as nation-based files while othersn
  \                                are available only as state-based files.nn                                 County
  subdivisions are the primary divisions of counties and their equivalent entities
  for the reporting of Census Bureau data. Theyn                                 include
  legally-recognized minor civil divisions (MCDs) and statistical census county divisions
  (CCDs), and unorganized territories.n                                 For the 2010
  Census, the MCDs are the primary governmental and/or administrative divisions of
  counties in 29 States and Puerto Rico;n                                 Tennessee
  changed from having CCDs for Census 2000 to having MCDs for the 2010 Census.  In
  MCD States where no MCD exists or is notn                                 defined,
  the Census Bureau creates statistical unorganized territories to complete coverage.
  \ The entire area of the United States,n                                 Puerto
  Rico, and the Island Areas is covered by county subdivisions.  The boundaries of
  most legal MCDs are as of January 1, 2013, asn                                 reported
  through the Census Bureau's Boundary and Annexation Survey (BAS).n            \",\n\t\"license_title\":
